import logo from "../../assets";

export const RegisterPage = () => {
  return (
    <StyledSectionRegister>
      <div>
        <div>
          <img src={logo} alt="logo" />
          <button>Sair</button>
        </div>
        <form></form>
      </div>
    </StyledSectionRegister>
  );
};
